$(function(){"use strict";$(".input-add button").each(function(){$(this).click(function(){var e=$(this).parents("ul");var t=e.data("counter");var n=e.data("prototype");var r=$("<li></li>");r.html(n.replace(/__name__/g,t++));r.find("button").click(function(){$(this).parents("li").remove()});$(this).parent("li").before(r);e.data("counter",t)})})})
